import {
  Button,
  Heading,
  HFlow,
  Icon,
  Modal,
  ModalBody,
  ModalFooter,
  Text,
  VFlow,
} from "bold-ui";
import React from "react";

interface ModalForgetPasswordProps {
  open: boolean;
  onClose(): void;
}

export function ModalForgetPassword(props: ModalForgetPasswordProps) {
  const { open, onClose } = props;

  return (
    <>
      <Modal size="large" onClose={onClose} open={open}>
        <ModalBody>
          <VFlow>
            <HFlow alignItems="center">
              <Icon
                icon="cutleryFilled"
                style={{ marginRight: "0.5rem" }}
                size={3}
                fill="info"
              />
              <Heading level={1}>Alterar senha</Heading>
            </HFlow>
            <Text component="p" variant="main">
              Por favor, entre em contato com o seu supervisor para alterar sua
              senha.
            </Text>
          </VFlow>
        </ModalBody>
        <ModalFooter>
          <HFlow justifyContent="flex-end">
            <Button onClick={onClose}>Sair</Button>
            <Button kind="primary" onClick={onClose}>
              Concluir
            </Button>
          </HFlow>
        </ModalFooter>
      </Modal>
    </>
  );
}
